import React from "react";
import Carts from "../Carts/Carts";



const Products = () => {
    return ( 
        <React.Fragment>
            {Products.map(p => (
                <Carts
                key={p.id}
                product={p}
                ></Carts>
            ))}
        </React.Fragment>
    );
}

export default Products;
